export default function Details({match}){
    const [moreDetails, setMoreDetails] = useState([]);

    useEffect(()=> {
        getDetails();
        console.log(match);
    },[]);

    async function getDetails(){

        const response = await fetch(`https://api.chucknorris.io/jokes/${match.params.id}`);
        const data = await response.json();
        console.log(data);
        setMoreDetails(data);

    }
    let x =[];
    x = [...x, moreDetails.created_at]
    console.log(x);

    return (
        <div>
            <h3>Details...</h3>
            <div><img src={moreDetails.icon_url} /></div>
            
            <div><a href={moreDetails.url}>external</a></div>
        </div>
    );
}
